function extractPageData(body) {
  // extract `imageId` from <img src="../img/IMAGE_ID.png?v">
  const imageId = body.match(/img\/(.*?)\.png/)[1];

  // extract `footerContent` from <div class="footer" style="color: #cc0000; font-weight: bold;">有效期限 : 12/18 14:12</div>
  const footerContent = body.match(/有效期限 : (.*?)<\/div>/)[1];

  return { imageId, footerContent };
}

function base64Decode(input) {
  // Define Base64 characters
  const chars =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";

  // Remove any characters not in the Base64 characters list
  // and replace any '=' padding with ''
  let str = input.replace(/[^A-Za-z0-9+/]/g, "").replace(/=+$/, "");

  // Decoding
  let output = "";
  for (
    let bc = 0, bs = 0, buffer, i = 0;
    (buffer = str.charAt(i++));
    ~buffer && ((bs = bc % 4 ? bs * 64 + buffer : buffer), bc++ % 4)
      ? (output += String.fromCharCode(255 & (bs >> ((-2 * bc) & 6))))
      : 0
  ) {
    buffer = chars.indexOf(buffer);
  }

  // Handle UTF-8 decoding
  return decodeURIComponent(escape(output));
}

const b64ContentHTML =
  "";

const contentHTML = base64Decode(b64ContentHTML);

if (!$response.body) {
  console.warn("no response received. leaving response intact");
  $done();
} else {
  const body = $response.body;
  const pageData = extractPageData(body);
  const pageDataHTML = `<script type="application/json" id="pagedata">${JSON.stringify(
    pageData
  )}</script>`;
  const replacedPageContent = contentHTML.replace(
    "__PAGE_DATA_PLACEHOLDER__",
    pageDataHTML
  );

  $done({
    body: replacedPageContent,
  });
}
